import {Menu} from 'semantic-ui-react';

export default function Header(){
    return (
        <Menu color = "purple" inverted widths={10}>
            <Menu.Item>
                CrowdCoin
            </Menu.Item>

            <Menu.Menu position = "right">
                <Menu.Item>
                    Campaigns
                </Menu.Item>
                <Menu.Item>
                    +
                </Menu.Item>
            </Menu.Menu>
        </Menu>
    );
}
